import { BrowserRouter, Routes, Route } from 'react-router-dom';

export default function  Rotas(){
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/" exact component={Home}/>
                <Route/>
            </Routes>
        </BrowserRouter>
    )
}
